import React from 'react'
import { useRoutes } from "react-router-dom";
import Home from './pages/Home';
import Blog from './pages/Blog';

function Router() {
  return useRoutes([
    {
      path: "/",
      element: <Home />
    },
    { path: "/blog", element: <Blog /> }
  ]);
}
export default Router
